  const setNameGeneratorContext = (): NameGeneratorContextInterface => {
    return {};
  };

  return (
    <NameGeneratorContext.Provider value={setNameGeneratorContext()}>
      <WordSelectForm />

    {/*  GeneratorOutput*/}
